import React, { Component } from 'react';
import App from './App';

class Signup extends Component {
    render() { 
        return (
            <React.Fragment>
                <App active="signup"/>
                <div className="content" style={{ height: "calc(100vh - 56px)", flexDirection: "column", display: "flex", justifyContent: "center", alignItems: "center"}}>
                    <div>
                        <input type="text" placeholder="Username" />
                    </div>
                    <div>
                        <input type="password" placeholder="Password" />
                    </div>
                    <div>
                        <input type="password" placeholder="Password" />
                    </div>
                    <div style={{width: "258px"}}>
                        <button>Signup</button>
                    </div>
                </div>
            </React.Fragment>
        );
    }
}
 
export default Signup;
